import axios from 'axios';
import {useEffect, useState} from 'react';
import './App.css';

const baseURL= "http://localhost:8080";
function App() {
  const [message, setMessage]= useState("Jola");

  useEffect(()=>{
    const getMesseage= async ()=>{
      await axios.get(baseURL).then(res=>{
        setMessage(res.data);
      });
    }
   getMesseage(); 
  }, [message]);
  return (<div>
    Hello {message}
  </div>
  );
}

export default App;
